// UserTestResultsPage.jsx
import React, { useState, useEffect, useRef } from "react";
import { Link } from "react-router-dom";
import { useUserRoleAccess } from "../Functions/apiUtils";

export default function UserTestResultsPage() {
    const checkUserRoleAccess = useUserRoleAccess(0);
    const [userEmail, setUserEmail] = useState("");
    const [userId, setUserId] = useState("");
    const [userRole, setUserRole] = useState("");
    const [userAnswers, setUserAnswers] = useState([]);
    const [professions, setProfessions] = useState({});
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    
    // Define a ref to track previous userId
    const previousUserId = useRef(null);

    useEffect(() => {
        // Fetch user information from session storage or state
        const userEmailFromStorage = sessionStorage.getItem("user_email");
        const userIdFromStorage = sessionStorage.getItem("user_id");
        const userRoleFromStorage = sessionStorage.getItem("user_role");
    
        setUserEmail(userEmailFromStorage);
        setUserId(userIdFromStorage);
        setUserRole(userRoleFromStorage);
    
        if (!checkUserRoleAccess() || !userId) {
            setLoading(false);
            return;
        }
    
        // Fetch user answers from the backend API only if userId has changed
        if (userId !== previousUserId.current) {
            setLoading(true);
            fetch(`http://localhost:5000/user_answers/${userId}`)
                .then((response) => {
                    if (!response.ok) {
                        throw new Error("Failed to fetch user answers");
                    }
                    return response.json();
                })
                .then((data) => {
                    setUserAnswers(data.userAnswers);
                    setLoading(false);
                })
                .catch((error) => {
                    setError(error);
                    setLoading(false);
                });
            previousUserId.current = userId; // Update previousUserId ref
        }
    }, [userId, checkUserRoleAccess]);

    // Fetch profession details for each profession test ID
    useEffect(() => {
        // Group user answers by profession test ID
        const groupedProfessionIds = userAnswers.reduce((acc, answer) => {
            if (!acc.includes(answer.prof_test_id)) {
                acc.push(answer.prof_test_id);
            }
            return acc;
        }, []);

        groupedProfessionIds.forEach((profTestId) => {
            fetch(`http://localhost:5000/get_profession_name/${profTestId}`)
                .then((response) => {
                    if (!response.ok) {
                        throw new Error("Failed to fetch profession name");
                    }
                    return response.json();
                })
                .then((data) => {
                    setProfessions((prevProfessions) => ({
                        ...prevProfessions,
                        [profTestId]: data.profession_name,
                    }));
                })
                .catch((error) => {
                    console.error("Error fetching profession name:", error);
                });
        });
    }, [userAnswers]);

    if (loading) {
        return <div>Loading...</div>;
    }

    if (error) {
        return <div>Error: {error.message}</div>;
    }

    // Group user answers by profession test ID
    const groupedUserAnswers = {};
    userAnswers.forEach((answer) => {
        if (!groupedUserAnswers[answer.prof_test_id]) {
            groupedUserAnswers[answer.prof_test_id] = [];
        }
        groupedUserAnswers[answer.prof_test_id].push(answer);
    });

    return (
        <div>
            <div className="container h-100">
                <div className="row h-100">
                    <div className="col-12">
                        <h1>Welcome to this User</h1>
                        <p>User Email: {userEmail}</p>
                        <p>User ID: {userId}</p>
                        <p>User Role: {userRole}</p>
                        
                        {/* Display user answers grouped by profession test */}
                        {Object.entries(groupedUserAnswers).map(([testId, answers]) => (
                            <div key={testId}>
                                <h2>Profession Name: {professions[testId]}</h2>
                                <ul>
                                    {answers.map((answer, index) => (
                                        <li key={answer.id}>
                                            <ul>
                                            <li>Question: {answer.question_text}</li>
                                            <li>Level: {answer.question_level}</li>
                                            <li>User Answer: {answer.user_answer}</li>
                                            <li>Correct/Incorrect: {answer.correct_incorrect === 1 ? "Correct" : "Incorrect"}</li>
                                            {index === answers.length - 1 && (
                                                <div>
                                                    <p>Comment on Result:</p> {answer.comment_on_result}
                                                </div>
                                            )}
                                            </ul>
                                        </li>
                                    ))}
                                </ul>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}
